import React from "react";
import Calling from "../components/project_1/calling_back";
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function Home(){
    return(
        <div>
            <BrowserRouter>
            <Routes>
                <Route path="/callback-task" element ={<Calling/>}/ >
                </Routes>
            </BrowserRouter>
        </div>
    )
}

export default Home;
